import Footer from './Footer';

function DefaultLayout({children}) {
    return (
        <>
            <Header />
            <div className='container'>
                <div className='content'>
                    {children}
                </div>
            </div>
            <Footer/>
        </>
    );
}

export default DefaultLayout;
